import React from "react";
import TodoItem from "./item/TodoItem";

const todos = [
    {
        id: '1',
        title: 'front',
        isCompleted: false,
    },
    {
        id: '2',
        title: 'web',
        isCompleted: false,
    },
    {
        id: '3',
        title: 'flutter',
        isCompleted: false,
    },
    {
        id: '4',
        title: 'front x2',
        isCompleted: false,
    },

]

const Home = () => {
    return (
        <div className='bg-gray-900 h-screen text-white w-4/5 mx-auto'>
            <p>home </p>

            {
                todos.map(todo => (
                    <TodoItem key={todo.id} todo={todo}/>
                ))
            }
        </div>
    )
}

export default Home
